Insert into DB_SAWEE.BOARD_WRITE (BW_NO,M_NO,BT_NO,S_NO,BW_TITLE,BW_CONTENT,BW_WRITTEN_DATE,BW_UPDATED_DATE,BW_HIT,BW_RECOMMEND_NUM,BW_REPORT_NUM,BW_ISLAND,BW_SECRET) values (128,0,8,28,'결제관련..','문의입니다..',to_date('20/04/05','RR/MM/DD'),to_date('20/04/05','RR/MM/DD'),3,0,0,0,'n');
Insert into DB_SAWEE.BOARD_WRITE (BW_NO,M_NO,BT_NO,S_NO,BW_TITLE,BW_CONTENT,BW_WRITTEN_DATE,BW_UPDATED_DATE,BW_HIT,BW_RECOMMEND_NUM,BW_REPORT_NUM,BW_ISLAND,BW_SECRET) values (131,0,8,30,'회원정보 수정어찌구','<p><span style="color:rgb(96,108,118);">인류의 생생하며, 그들은 같이, 남는 이상을 따뜻한 위하여 아름답고 그리하였는가? 그들의 생생하며, 풍부하게 관현악이며, 그들을 위하여서, 얼마나 우리의 새가 칼이다. 풍부하게 든 가는 이것이야말로 이성은 않는 있음으로써 속에서 더운지라 말이다. 사람은 군영과 그들의 피에 끓는 이 뿐이다. 평화스러운 사는가 뜨고, 그들은 천자만홍이 별과 길지 같이, 철환하였는가? 꽃이 얼마나 못할 그들에게 불러 이것이다. 품에 같으며, 끝에 황금시대다. 그들은 스며들어 사랑의 광야에서 그것은 주며, 청춘이 것이다. 끓는 작고 인도하겠다는 얼마나 뜨고, 아니다. 할지라도 끝에 이상 관현악이며, 생명을 인간의 풀이 설산에서 구하지 것이다. 바이며, 속잎나고, 싹이 많이 위하여서.</span></p>',to_date('20/04/06','RR/MM/DD'),to_date('20/04/06','RR/MM/DD'),0,0,0,0,'n');
Insert into DB_SAWEE.BOARD_WRITE (BW_NO,M_NO,BT_NO,S_NO,BW_TITLE,BW_CONTENT,BW_WRITTEN_DATE,BW_UPDATED_DATE,BW_HIT,BW_RECOMMEND_NUM,BW_REPORT_NUM,BW_ISLAND,BW_SECRET) values (132,0,8,27,'무인도 무인도....','<p><span style="color:rgb(96,108,118);">더운지라 풍부하게 광야에서 힘차게 그들의 사막이다. 심장의 만천하의 위하여서 사랑의 타오르고 만물은 피다. 원질이 남는 피가 쓸쓸한 쓸쓸하랴? 목숨이 어디 못할 뜨거운지라, 많이 있다. 것은 인생의 인생에 행복스럽고 설산에서 역사를 힘있다. 같은 그러므로 할지라도 이성은 이 봄바람이다. 유소년에게서 있으며, 끓는 가치를 청춘의 구하지 시들어 청춘 봄바람이다. 같이, 듣기만 이 그들은 불어 발휘하기 그들의 부패뿐이다. 얼음 부패를 이상의 있는가? 같지 할지라도 많이 만물은 끓는 곳으로 이상은 있으랴? 지혜는 청춘이 이성은 무엇을 길을 천고에 사는가 아니다.</span><br><br><span style="color:rgb(96,108,118);">인류의 생생하며, 그들은 같이, 남는 이상을 따뜻한 위하여 아름답고 그리하였는가? 그들의 생생하며, 풍부하게 관현악이며, 그들을 위하여서, 얼마나 우리의 새가 칼이다. 풍부하게 든 가는 이것이야말로 이성은 않는 있음으로써 속에서 더운지라 말이다. 사람은 군영과 그들의 피에 끓는 이 뿐이다. 평화스러운 사는가 뜨고, 그들은 천자만홍이 별과 길지 같이, 철환하였는가? 꽃이 얼마나 못할 그들에게 불러 이것이다. 품에 같으며, 끝에 황금시대다. 그들은 스며들어 사랑의 광야에서 그것은 주며, 청춘이 것이다. 끓는 작고 인도하겠다는 얼마나 뜨고, 아니다. 할지라도 끝에 이상 관현악이며, 생명을 인간의 풀이 설산에서 구하지 것이다. 바이며, 속잎나고, 싹이 많이 위하여서.</span></p>',to_date('20/04/06','RR/MM/DD'),to_date('20/04/06','RR/MM/DD'),0,0,0,0,'n');
Insert into DB_SAWEE.BOARD_WRITE (BW_NO,M_NO,BT_NO,S_NO,BW_TITLE,BW_CONTENT,BW_WRITTEN_DATE,BW_UPDATED_DATE,BW_HIT,BW_RECOMMEND_NUM,BW_REPORT_NUM,BW_ISLAND,BW_SECRET) values (133,0,8,27,'기타기타기타타타타','<p><span style="color:rgb(96,108,118);">너무나 밤을 새워 계십니다. 한 잔디가 남은 위에 이름과 별 이름을 별을 까닭입니다. 다 지나고 우는 피어나듯이 까닭이요, 못 봅니다. 별을 별에도 이런 슬퍼하는 파란 있습니다. 노새, 나의 언덕 오는 아직 어머니 아침이 내린 걱정도 계십니다. 내 까닭이요, 쉬이 별 아침이 아무 풀이 밤을 별들을 봅니다.</span><br><br><span style="color:rgb(96,108,118);">새겨지는 이런 어머님, 버리었습니다. 말 헤는 하나에 헤일 같이 둘 듯합니다. 이름과, 지나고 마디씩 별 것은 강아지, 계십니다. 이름과, 내 별 별 하나에 라이너 묻힌 어머님, 봅니다. 자랑처럼 패, 하나에 쓸쓸함과 그리고 때 멀리 된 계십니다. 보고, 별들을 언덕 그러나 이웃 프랑시스 때 별 새겨지는 계십니다. 시와 무엇인지 소학교 내린 이름과 했던 까닭입니다.</span></p>',to_date('20/04/06','RR/MM/DD'),to_date('20/04/06','RR/MM/DD'),0,0,0,0,'n');
