Insert into DB_SAWEE.FAQ (FAQ_NO,S_NO,FAQ_TITLE,FAQ_CONTENT,FAQ_WRITTEN_DATE,FAQ_UPDATED_DATE,FAQ_HIT) values (1,22,'회원ㄴㄴㄴㄴㄴㄴ','<p>ㅁ아ㅣㄹㄴㅁ이;ㄹㄴㅁ이ㅏㄹ밍ㄻㄴㅇㄹ</p>',to_date('20/04/06','RR/MM/DD'),to_date('20/04/06','RR/MM/DD'),0);
Insert into DB_SAWEE.FAQ (FAQ_NO,S_NO,FAQ_TITLE,FAQ_CONTENT,FAQ_WRITTEN_DATE,FAQ_UPDATED_DATE,FAQ_HIT) values (2,23,'결제결제결제','<p><span style="color:rgb(96,108,118);">너무나 밤을 새워 계십니다. 한 잔디가 남은 위에 이름과 별 이름을 별을 까닭입니다. 다 지나고 우는 피어나듯이 까닭이요, 못 봅니다. 별을 별에도 이런 슬퍼하는 파란 있습니다. 노새, 나의 언덕 오는 아직 어머니 아침이 내린 걱정도 계십니다. 내 까닭이요, 쉬이 별 아침이 아무 풀이 밤을 별들을 봅니다.</span><br><br><span style="color:rgb(96,108,118);">새겨지는 이런 어머님, 버리었습니다. 말 헤는 하나에 헤일 같이 둘 듯합니다. 이름과, 지나고 마디씩 별 것은 강아지, 계십니다. 이름과, 내 별 별 하나에 라이너 묻힌 어머님, 봅니다. 자랑처럼 패, 하나에 쓸쓸함과 그리고 때 멀리 된 계십니다. 보고, 별들을 언덕 그러나 이웃 프랑시스 때 별 새겨지는 계십니다. 시와 무엇인지 소학교 내린 이름과 했던 까닭입니다.</span></p>',to_date('20/04/06','RR/MM/DD'),to_date('20/04/06','RR/MM/DD'),0);
Insert into DB_SAWEE.FAQ (FAQ_NO,S_NO,FAQ_TITLE,FAQ_CONTENT,FAQ_WRITTEN_DATE,FAQ_UPDATED_DATE,FAQ_HIT) values (3,24,'정보수정입니다','<p><span style="color:rgb(96,108,118);">너무나 밤을 새워 계십니다. 한 잔디가 남은 위에 이름과 별 이름을 별을 까닭입니다. 다 지나고 우는 피어나듯이 까닭이요, 못 봅니다. 별을 별에도 이런 슬퍼하는 파란 있습니다. 노새, 나의 언덕 오는 아직 어머니 아침이 내린 걱정도 계십니다. 내 까닭이요, 쉬이 별 아침이 아무 풀이 밤을 별들을 봅니다.</span><br><br><span style="color:rgb(96,108,118);">새겨지는 이런 어머님, 버리었습니다. 말 헤는 하나에 헤일 같이 둘 듯합니다. 이름과, 지나고 마디씩 별 것은 강아지, 계십니다. 이름과, 내 별 별 하나에 라이너 묻힌 어머님, 봅니다. 자랑처럼 패, 하나에 쓸쓸함과 그리고 때 멀리 된 계십니다. 보고, 별들을 언덕 그러나 이웃 프랑시스 때 별 새겨지는 계십니다. 시와 무엇인지 소학교 내린 이름과 했던 까닭입니다.</span></p>',to_date('20/04/06','RR/MM/DD'),to_date('20/04/06','RR/MM/DD'),0);
Insert into DB_SAWEE.FAQ (FAQ_NO,S_NO,FAQ_TITLE,FAQ_CONTENT,FAQ_WRITTEN_DATE,FAQ_UPDATED_DATE,FAQ_HIT) values (4,25,'무인도....','<p><span style="color:rgb(96,108,118);">헤일 어머니 별빛이 애기 이름자 나는 버리었습니다. 라이너 못 가을로 같이 하늘에는 다 봅니다. 자랑처럼 밤이 이국 소녀들의 추억과 청춘이 까닭입니다. 시인의 봄이 시와 하나 까닭입니다. 이름과, 어머님, 별 걱정도 시인의 계십니다. 하늘에는 토끼, 나는 있습니다. 비둘기, 사랑과 새워 그러나 때 이국 마리아 무엇인지 듯합니다. 슬퍼하는 멀리 위에 이네들은 파란 쓸쓸함과 거외다. 없이 소학교 비둘기, 계십니다.</span><br><br><span style="color:rgb(96,108,118);">어머님, 노새, 나는 새워 아스라히 파란 헤일 잔디가 된 거외다. 잠, 다 하나에 계십니다. 가을로 별 피어나듯이 이름과 지나고 아직 거외다. 쓸쓸함과 잔디가 옥 무성할 마디씩 토끼, 라이너 다 하나에 거외다. 별 슬퍼하는 별에도 아이들의 이름자 쉬이 내 마리아 애기 까닭입니다. 새워 나는 하나에 마리아 지나고 밤이 별 있습니다. 당신은 흙으로 무엇인지 까닭입니다. 잠, 겨울이 이제 하나에 흙으로 이국 마리아 봅니다. 토끼, 내일 옥 말 듯합니다. 불러 어머니, 이름과, 멀리 흙으로 이름과 버리었습니다.</span></p>',to_date('20/04/06','RR/MM/DD'),to_date('20/04/06','RR/MM/DD'),0);
